INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, "春咲 ひより", 1, 0, "お！\nあそこに困ってそうな人発見！", 0, 2, 1.4, 0, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("みんなみたいに\nわたしも強くならなきゃ", 0, 1, "草野 優衣", 1, 0, "大切な人を\n守れるようになりたい…って", 0, 2, 1.4, 0, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("フェンシングを始めてみては？", 0, 1, "士条 怜", 1, 0, "キミに必要な集中力と感性が", 0, 2, 1.4, 0, 1003, "少しは磨かれると思いますよ。", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ねぇ、にいちゃん！", 0, 1, "穂高 みそぎ", 1, 0, "今日はなにして遊ぶ？", 0, 2, 1.5, 0, 1004, "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("風宮あかりです", 0, 1, "風宮 あかり", 1, 0, "ねぇ…", 0, 2, 1.4, 0, 1006, "私といっしょに…\nいかない？", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("出雲宮子なのー", 0, 1, "出雲 宮子", 1, 0, "プリンたべたいのー", 0, 2, 1.5, 0, 1007, "食べ物の恨みは怖いのー", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ボクは虹村雪。", 0, 1, "虹村 雪", 1, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 2, 1.4, 0, 1008, "いいよ。\n見られることは運命さ…", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("フッ…聞いて後悔するがいい！", 0, 1, "柊杏奈", 1, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 2, 1.4, 0, 1009, "人呼んで「疾風の冥姫」!!", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("マホマホ王国のプリンセス、\nまほ姫どす", 0, 1, "姫宮 真歩", 1, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 2, 1.5, 0, 1010, "ほんまおおきにやわ～♪", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("衣之咲璃乃です！", 0, 1, "衣之咲 璃乃", 1, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 2, 1.4, 0, 1011, "ここで会ったが\n100年目～！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 1, "柏崎 初音", 1, 0, "ち、超能力って…\n何のことかな～？", 0, 2, 1.4, 0, 1012, "…って、お願い！\n誰にも言わないでおいて～！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ちょす！\n美波鈴奈だよ～♪", 0, 1, "美波 鈴奈", 1, 0, "一応カリスマ読モJKやってまっす！", 0, 2, 1.4, 0, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("はいたーい。\n喜屋武香織さー。", 0, 1, "喜屋武 香織", 1, 0, "東京は遊園地みたいなところさー", 0, 2, 1.4, 0, 1017, "でも、沖縄もとってもいいとこさー", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("支倉伊緒です。", 0, 1, "支倉 伊緒", 1, 0, "先生って呼ばれるのは\nくすぐったいから", 0, 2, 1.4, 0, 1018, "イオちゃんって呼んでね。", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 1, "茜 ミミ", 1, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 2, 1.5, 0, 1020, "ミミをおいてかないでぇ～", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あ…あの…えっと…\n栗…林…くるみ…です……", 0, 1, "栗林 くるみ", 1, 0, "あの……\nふぇ……", 0, 2, 1.5, 0, 1021, "ふぇぇぇぇぇん……", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("風宮よりです。\nあああああ！", 0, 1, "風宮 より", 1, 0, "こんな私に貴重な時間を\n割いていただき、", 0, 2, 1.4, 0, 1022, "なんてありがとうございます！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 1, "北条 綾音", 1, 0, "おにいちゃんどこいくの？\nえ？", 0, 2, 1.5, 0, 1023, "私こっち行きたいー\nね、早く早くー", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("わっ…わっ…私、\n天野すずめといいます！", 0, 1, "天野 すずめ", 1, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 2, 1.4, 0, 1025, "これて何か違う…\nあああすみません！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("……クスクス…私は\n…倉石恵理子……", 0, 1, "倉石 恵理子", 1, 0, "あなたは…運命の……\n伴侶……", 0, 2, 1.4, 0, 1027, "離しませんわ………\n絶対に…!!", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 1, "佐々木 咲恋", 1, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 2, 1.4, 0, 1028, "…そうでしょ？？", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("桜井望だよ！\nよろしくねっ", 0, 1, "桜井 望", 1, 0, "ぇっと…\nキミ、私のこと知らないの?!", 0, 2, 1.4, 0, 1029, "あはは、\n私もまだまだだなぁ～", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("デケデケデンっ！", 0, 1, "ニノン・ジュベール", 1, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 2, 1.4, 0, 1030, "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("上喜しのぶです。\n手元のドクロが父です。", 0, 1, "上喜 しのぶ", 1, 0, "でもって私の隣にいるのが……\nえ、見えない？", 0, 2, 1.4, 0, 1031, "おかしいですね……", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("目指すはビッグな\nお笑い芸人だっぺ！", 0, 1, "野戸まひる", 1, 0, "けんども\nそれには足りないモンが…", 0, 2, 1.5, 0, 1033, "そう、\nオラのボケに突っ込める相方が…！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 1, "綾瀬 ゆかり", 1, 0, "ちょっと緊張しちゃって…", 0, 2, 1.4, 0, 1034, "ちょ\nちょっと一杯飲んできます…！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("氷川鏡華…です", 0, 1, "氷川 鏡華", 1, 0, "知らない人とは話しちゃいけないので", 0, 2, 1.5, 0, 1036, "これ以上お話しすることは…\nないです！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("柏崎…栞です。", 0, 1, "柏崎 栞", 1, 0, "……あ、アラーム。", 0, 2, 1.4, 0, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ふ、双葉碧です。", 0, 1, "双葉 碧", 1, 0, "私、一人も友達がいなくて……", 0, 2, 1.4, 0, 1040, "野に咲く花が、\n唯一の話相手です。", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("三角千歌です。", 0, 1, "三角 千歌", 1, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 2, 1.4, 0, 1042, "そう思っています。", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("安芸真琴だ。", 0, 1, "安芸 真琴", 1, 0, "あぁ？\nお前のそいつの仲間か？", 0, 2, 1.4, 0, 1043, "う、疑ってすまなかったな…", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("わらわこそは夜を総べる者！", 0, 1, "イリヤ・オーンスタイン", 1, 0, "生けとし生ける全ての者よ！", 0, 2, 1.4, 0, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("そこで騎士は妖精を乱暴に……", 0, 1, "遠見 空花", 1, 0, "ぐふふふふ……はっ！", 0, 2, 1.4, 0, 1045, "ｌク、クウカに何かご用ですか!?", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 1, "宮坂たまき", 1, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 2, 1.4, 0, 1046, "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("大神美冬よ！", 0, 1, "大神 美冬", 1, 0, "それでは早速クエストに…", 0, 2, 1.4, 0, 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("星野静流だよ！", 0, 1, "星野静流", 1, 0, "クエストもバトルも\n掃除も洗濯も", 0, 2, 1.4, 0, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("アタシは玉泉美咲。", 0, 1, "玉泉美咲", 1, 0, "見ての通りの\nセクシー美少女で", 0, 2, 1.5, 0, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("？？？", 0, 1, "リマ", 1, 0, "？？？？", 0, 2, 1.4, 0, 1052, "？？？？", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("モニカ・ヴァイスヴィントだ。", 0, 1, "モニカ・ヴァイスヴィント", 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, 2, 1.5, 0, 1053, "そ、そこまでいうなら\nもらってやる", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("モニカ・ヴァイスヴィントだ。", 0, 1, "ペコリーヌ", 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, 2, 1.5, 0, 1058, "そ、そこまでいうなら\nもらってやる", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("モニカ・ヴァイスヴィントだ。", 0, 1, "コッコロ", 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, 2, 1.5, 0, 1059, "そ、そこまでいうなら\nもらってやる", 1, 0);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("モニカ・ヴァイスヴィントだ。", 0, 1, "キャル", 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, 2, 1.5, 0, 1060, "そ、そこまでいうなら\nもらってやる", 1, 0);
